Object.Field:
select  distinct
	TRIM(SISY) SMOD_CODE,
  	NVL(LIBELLE,TRIM(SISY))  SMOD_NAME
FROM <%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860
inner join ALL_TABLES on (OWNER ='<%=odiRef.getModel("SCHEMA_NAME")%>'  and TRIM(SIOBNM) = TABLE_NAME)
left outer join (
					select F0005.DRKY SYSCODE,F0005.DRKY||' - '||NVL(F0005D.DRDL01,F0005.DRDL01) LIBELLE ,F0005.DRDL01
					from <%=odiRef.getOption("JDE_CONTROL_TABLES")%>.F0005 
					left outer join <%=odiRef.getOption("JDE_CONTROL_TABLES")%>.F0005D  on (TRIM(F0005D.DRRT) = 'SY' and trim(F0005D.DRSY) = 'H90' and TRIM(DRLNGP) = '<%=odiRef.getOption("JDE_LANGUAGE")%>'  and F0005.DRKY = F0005D.DRKY)
					where TRIM(F0005.DRRT) = 'SY' and trim(F0005.DRSY) = 'H90' 

			) LIB on ( trim(SYSCODE) = trim(SISY) )
where 
	TRIM(SIOBNM) like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
	and SIFUNO='TBLE'	
<% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( " and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( " and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>

select  distinct
	TRIM(SISY)||'(T)' SMOD_CODE,
  	TRIM(SISY)||'- Data tables'	SMOD_NAME,
	TRIM(SISY) SMOD_PARENT_CODE
FROM <%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860
inner join ALL_TABLES on (OWNER ='<%=odiRef.getModel("SCHEMA_NAME")%>'  and TRIM(SIOBNM) = TABLE_NAME)
where
	TRIM(SIOBNM) like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
	and SIFUNO='TBLE'	
	and TRIM(SIOBNM) not like '%Z%'
<% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>

SELECT 	/*+ APPEND */
	TRIM(CT.SIMD)||'_'||TRIM(T.THOBNM)				TABLE_NAME,
	TRIM(T.THOBNM)					RES_NAME,
	CT.SIPFX||SUBSTR(T.THOBNM,4)				TABLE_ALIAS,
	TRIM(CT.SIMD)					TABLE_DESC,
	TRIM(CT.SISY)||decode(instr(THOBNM,'Z'), 0,'(T)','(Z)') 		SMOD_CODE,
	AT.NUM_ROWS  					R_COUNT
FROM <%=odiRef.getOption("JDE_CENTRAL_OBJECTS")%>.F98710 T
INNER JOIN 	<%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860 CT ON ( T.THOBNM=CT.SIOBNM AND  CT.SIFUNO='TBLE'  <% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>  ) 
INNER JOIN 	ALL_TABLES AT ON (TRIM(T.THOBNM)=AT.TABLE_NAME AND AT.OWNER= '<%=odiRef.getModel("SCHEMA_NAME")%>' )
where  T.THOBNM like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
and T.THOBNM not like '%Z%'

select 	TRIM(CT.SIMD)||'_'||TRIM(C.TDOBNM) TABLE_NAME, 
		TRIM(C.TDSQLC) COL_NAME,
		SUBSTR(trim(NVL(LNGSPEC.FRDSCR,LNGDEF.FRDSCR)),1,35) COL_HEADING,
		trim(NVL(LNGSPEC.FRDSCR,LNGDEF.FRDSCR)) COL_DESC,
		TDPSEQ POS,
      ORACLE_COLUMNS.DT_DRIVER DT_DRIVER,
      ORACLE_COLUMNS.LONGC LONGC,
      ORACLE_COLUMNS.SCALEC SCALEC,
      ORACLE_COLUMNS.COL_MANDATORY COL_MANDATORY
from <%=odiRef.getOption("JDE_CENTRAL_OBJECTS")%>.F98711 C 
left outer join <%=odiRef.getOption("JDE_DATA_DICTIONARY")%>.F9202 LNGDEF   on (c.tdobnd=LNGDEF.frdtai and  LNGDEF.FRLNGP =' ' and LNGDEF.FRSYR = ' ') 
left outer join <%=odiRef.getOption("JDE_DATA_DICTIONARY")%>.F9202  LNGSPEC  on (c.tdobnd=LNGSPEC.frdtai and  TRIM(LNGSPEC.FRLNGP) ='<%=odiRef.getOption("JDE_LANGUAGE")%>' and LNGSPEC.FRSYR = ' ' ) 
INNER JOIN 	<%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860 CT ON ( CT.SIOBNM=C.TDOBNM AND  CT.SIFUNO='TBLE'  <% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>  
) 
INNER JOIN (select	c.TABLE_NAME	TABLE_NAME,
		c.COLUMN_NAME	COL_NAME,
		c.DATA_TYPE	DT_DRIVER,
		case
			when C.DATA_TYPE = 'NUMBER' then c.DATA_PRECISION
			when C.DATA_TYPE = 'CHAR' then c.CHAR_LENGTH
			when C.DATA_TYPE = 'NCHAR' then c.CHAR_LENGTH
			when C.DATA_TYPE = 'VARCHAR2' then c.CHAR_LENGTH
			when C.DATA_TYPE = 'NVARCHAR2' then c.CHAR_LENGTH
			else nvl(c.DATA_PRECISION,c.DATA_LENGTH)
		end LONGC,
		c.DATA_SCALE		SCALEC,
		decode(c.NULLABLE,'Y','0','1')	COL_MANDATORY
		from	ALL_TAB_COLUMNS	c
		Where	C. OWNER ='<%=odiRef.getModel("SCHEMA_NAME")%>'
		) ORACLE_COLUMNS ON (trim(C.TDOBNM) = ORACLE_COLUMNS.TABLE_NAME and  trim(C.TDSQLC) = ORACLE_COLUMNS.COL_NAME )
where trim(C.TDOBNM)  like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
and C.TDOBNM not like '%Z%'

Select  	/*+ APPEND */
	TRIM(CT.SIMD)||'_'||TRIM(TPOBNM)		TABLE_NAME,
	case when TPUNIQ=1 then 
		case when TPPRMF = 1 then 'PK' else 'AK' end
	else 'I' end			CONS_TYPE,
	TRIM(TPOBNM)||'_'||TPINID	KEY_NAME
from <%=odiRef.getOption("JDE_CENTRAL_OBJECTS")%>.F98712
inner join 	ALL_TABLES on TRIM(TPOBNM) = TABLE_NAME and  OWNER ='<%=odiRef.getModel("SCHEMA_NAME")%>'
INNER JOIN 	<%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860 CT ON ( CT.SIOBNM=TPOBNM AND  CT.SIFUNO='TBLE'  <% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>  ) 
where  TPOBNM like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
and TPOBNM not like '%Z%'

Select  	/*+ APPEND */
	TRIM(CT.SIMD)||'_'||TRIM(TLOBNM)		TABLE_NAME,
	TRIM(TLOBNM)||'_'||TLINID	KEY_NAME,
    	TRIM(TDSQLC)  		COL_NAME,
	TLCMPI			POS
FROM 	<%=odiRef.getOption("JDE_CENTRAL_OBJECTS")%>.F98713
INNER JOIN  <%=odiRef.getOption("JDE_CENTRAL_OBJECTS")%>.F98711 ON TLOBNM = TDOBNM and TDOBND = TLOBND
INNER JOIN 	<%=odiRef.getOption("JDE_OBJECT_LIBRARIAN")%>.F9860 CT ON ( CT.SIOBNM=TLOBNM AND  CT.SIFUNO='TBLE'  <% 
if ((odiRef.getOption("JDE_MODULES").length()>0)) 
{ 
	if ((odiRef.getOption("JDE_MODULES").indexOf(",")>0))
	{ 
	out.print( "	 and TRIM(SISY) in ("+odiRef.getOption("JDE_MODULES")+")" ); 
	}
	else
	{
		out.print( "	 and TRIM(SISY) like '"+odiRef.getOption("JDE_MODULES")+"'" ); 
	};
};
%>  ) 
INNER JOIN 	ALL_TABLES on TRIM(TLOBNM) = TABLE_NAME and OWNER ='<%=odiRef.getModel("SCHEMA_NAME")%>'
where  TLOBNM like '<%=odiRef.getModel("REV_OBJ_PATT")%>' 
and TLOBNM not like '%Z%'

